import LoginHeader from "./LoginHeader";
import Header from "./Header";
import Footer from "./Footer";
import CreateArea from "./CreateArea";

import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <Header />
      <LoginHeader />
      <CreateArea />
      <CreateArea />
      <CreateArea />
      <Footer />
      <nav>
        <Link to="/anotherpage">Another Page</Link>
      </nav>
    </div>
  );
}

export default Home;
